import React from "react";

import Card from "react-bootstrap/Card";
const Actors = (props) => {
  return (
    <div>
      <Card style={{ width: "15rem" }}>
        <Card.Img
          variant="top"
          src={`http://image.tmdb.org/t/p/w185/` + props.img}
          alt="no image found"
        />
        {props.name} {props.character}
      </Card>
    </div>
  );
};

export default Actors;
